シルエットネコさんのモバイルスタンドです。<br>
デスクに置いておくだけで可愛いですが、スマホの後ろから覗き込む感じがキュートです♪<br>
充電用のケーブルも通せます。<br>
お気に入りのポストカードやメモ立てとしてもいかがでしょう。<br>
ＳとＭサイズを販売中です。<br><br>

【ご確認事項】<br>
※曲がり具合やサイズに若干の違いが生じる場合があります。<br>
