リヒター初のマウント一体型、最新のスマートフォンホルダーです。
エアコンの吹き出し口にそのまま取り付けできます。
<br><br>

ワンハンドオペレーション、片手でスマホを簡単に脱着できます。
上部のアームはスプリング式、下部2本のアームは長さ調節が可能です。<br><br>

ホルダーは360°回転しますので、縦でも横でもOK。
裏面には充電時のケーブルを取り付けるためのクリップ付。
<br><br>

iPhone6プラスなど、大型のスマートフォンに最適です。
<br><br>
【製品の詳細】<br>
ボディーカラー：マットブラック<br>
対応機器サイズ：幅64mm ～ 92mm 厚み15mmまで<br>
固定方法：エアコンのフィンに直接取付<br>
